import React from 'react'

const Index = () => {
    return (
        <div>
            <div className="bg-red-300  py-4" >
                <img className="h-24 mx-auto" src="/logo.png" height="60" alt="logo fls"/>
            </div>
            <div className="bg-red-900 text-gray-100 ">Navbar</div>
        </div>
    )
}

export default Index
